import styled from "styled-components";
import PropTypes from "prop-types";

const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  padding-top: 5rem;
  width: 100%;
  height: calc(100vh - 5rem);
  flex-direction: column;
`;
const NavTitle = styled.div`
  width: 100%;
  height: 3rem;
  border: 3px solid var(--dark-brown);
  background-color: var(--red-brown);
  display: flex;
  justify-content: flex-start;
  align-items: center;
  padding-left: 1rem;
  box-sizing: border-box;
`;
const NavTitleText = styled.span`
  font-size: 1rem;
  font-weight: 600;
  color: var(--cream);
`;

const Events = styled.ul`
  width: 100vw;
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(4rem, auto));
  gap: 1rem;
`;

const EventContainer = styled.li`
  display: flex;
  flex-direction: column;
  border: 2px solid var(--border);
  list-style: none;
`;

const EventPosterContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
`;

const EventPoster = styled.img`
  width: 100%;
  height: 100%;
  object-fit: contain;
  border: 2px solid var(--border);
`;

